return {
    OnSave: function (form, gridview) {
        var detail = this.GET("InquiryDetail");
        if ((detail && detail.AllListViewItem.length > 0)) {
            var firstRow = detail.AllListViewItem[0];
            if (firstRow) {
                this.Entity.PolId = firstRow.Entity.PolId;
                this.Entity.PodId = firstRow.Entity.PodId;
                this.Entity.Pol = firstRow.Entity.Pol;
                this.Entity.Pod = firstRow.Entity.Pod;
            }
        }
        var detailFee = this.GET("DefaultFee");
        if (detailFee && detailFee.AllListViewItem.length > 0) {
            detailFee.AllListViewItem.filter(x => !x.GroupRow).forEach((item, index) => {
                item.Entity.Order = index;
            });
        }
    },
    ShowHideColumn2: function () {
        var summary = this.GET("Summary");
        if (!summary) {
            return;
        }
        var bookingDetail = this.GET("DefaultFee");
        var hide = [];
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name.includes('Min'))) {
            ["MinSub10"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name.includes("-45"))) {
            ["Sub45"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name.includes("+45"))) {
            ["Add45"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name == "+100")) {
            ["Add100"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name == "+300")) {
            ["Add300"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name == "+500")) {
            ["Add500"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name == "+1000")) {
            ["Add1000"].forEach(x => hide.push(x));
        }
        summary.HideColumn(...hide);
    },
    ShowHideColumn: function () {
        var summary = this.GET("Summary2");
        if (!summary) {
            return;
        }
        var bookingDetail = this.GET("DefaultFee");
        var hide = [];
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name.includes('Min'))) {
            ["CostMinSub10", "RevenueMinSub10", "ProfitMinSub10", "ProfitRateMinSub10"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name.includes("-45"))) {
            ["CostSub45", "RevenueSub45", "ProfitSub45", "ProfitRateSub45"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name.includes("+45"))) {
            ["CostAdd45", "RevenueAdd45", "ProfitAdd45", "ProfitRateAdd45"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name == "+100")) {
            ["CostAdd100", "RevenueAdd100", "ProfitAdd100", "ProfitRateAdd100"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name == "+300")) {
            ["CostAdd300", "RevenueAdd300", "ProfitAdd300", "ProfitRateAdd300"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name == "+500")) {
            ["CostAdd500", "RevenueAdd500", "ProfitAdd500", "ProfitRateAdd500"].forEach(x => hide.push(x));
        }
        if (!bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name == "+1000")) {
            ["CostAdd1000", "RevenueAdd1000", "ProfitAdd1000", "ProfitRateAdd1000"].forEach(x => hide.push(x));
        }
        summary.HideColumn(...hide);
    },
    CalcWeight: function (form, gridview) {
        var detail = this.GET("EntityDimension");
        if ((detail && detail.AllListViewItem.length > 0)) {
            var rowData = detail.AllListViewItem.map(x => x.Entity);
            var volumeWeight = rowData.reduce((a, b) => a.plus(((new this.Decimal(b.Width || 0)).times(new this.Decimal(b.Height || 0)).times(new this.Decimal(b.Length || 0))).times((new this.Decimal(b.Quantity || 0))).div(new this.Decimal(6000))), new this.Decimal(0));
            var kgs = rowData.reduce((a, b) => a.plus(((new this.Decimal(b.Width || 0)).times(new this.Decimal(b.Height || 0)).times(new this.Decimal(b.Length || 0))).times((new this.Decimal(b.Quantity || 0))).div(new this.Decimal(1000000))), new this.Decimal(0));
            this.EditForm.Entity.VolumeWeight = volumeWeight || new this.Decimal(0);
            this.EditForm.Entity.Kgs = kgs || new this.Decimal(0);
            this.EditForm.UpdateView(false, false, "VolumeWeight", "Kgs");
        }
    },
    SetDefaultCW: function (form, gridview) {
        var cw = this.Decimal(this.EditForm.Entity.VolumeWeight).greaterThan(this.Decimal(this.EditForm.Entity.GW)) ? this.EditForm.Entity.VolumeWeight : this.EditForm.Entity.GW;
        this.EditForm.Entity.CW = this.EditForm.Entity.CW || cw;
        this.EditForm.Entity.CBM = this.EditForm.Entity.CBM || this.EditForm.Entity.Kgs;
        this.EditForm.UpdateView(false, false, "CBM", "CW");
        this.EditForm.Dirty = true;
    },
    ShowHideDetail: function () {
        var detail1 = this.GET("DefaultFee");
        if (!detail1) {
            return;
        }
        if (this.EditForm.Entity.IsSimple) {
            detail1.HideColumn("Cost", "MinQuantityCost", "PayeeId");
        }
        else {
            detail1.HideColumn("");
        }
    },
    DuplicateFee: function (form, gridview) {
        var inquiryDetail = this.GET("InquiryDetail");
        var defaultFee = this.GET("DefaultFee");
        var newItem = JSON.parse(JSON.stringify(defaultFee.Header.filter(x => x.FieldName == "UnitId" || x.FieldName == "RouteId")));
        newItem.forEach(item => {
            item.FieldName = "View" + item.FieldName;
            if (item.FieldName == "ViewRouteId") {
                item.Order = 0;
                this.Entity.ViewRouteId = this.Entity.ViewRouteId || (inquiryDetail.AllListViewItem[0] ? `${(inquiryDetail.AllListViewItem[0].Entity.Pol.Code || '')} => ${(inquiryDetail.AllListViewItem[0].Entity.Pod.Code || '')}` : this.Entity.ViewRouteId);
            }
        })
        var form = this.EditForm.OpenConfig("Select group weight level!", () => {
            var selecteds = defaultFee.AllListViewItem.filter(x => !x.GroupRow && x.Selected);
            var otherGroup = inquiryDetail.AllListViewItem.find(x => form.Entity.ViewRouteId == `${(x.Entity.Pol.Code || '')} => ${(x.Entity.Pod.Code || '')}`);
            var newFees = JSON.parse(JSON.stringify(selecteds.map(x => x.Entity)));
            newFees.forEach(item => {
                item.Id = this.Uuid7.NewGuid();
                item.RouteId = (otherGroup.Entity.Pol.Code) + " - " + (otherGroup.Entity.Pod.Code || '');
                item.PolId = otherGroup.Entity.PolId;
                item.UnitId = form.Entity.ViewUnitId;
                item.RouteId = form.Entity.ViewRouteId;
                item.Unit = null;
                item.DisableRow = false;
                item.Pol = otherGroup.Entity.Pol;
                item.PodId = otherGroup.Entity.PodId;
                item.Pod = otherGroup.Entity.Pod;
                item.VendorId = otherGroup.Entity.VendorId;
            });
            defaultFee.LoadMasterData(newFees).then(() => {
                defaultFee.ClearSelected();
                defaultFee.AddRows(newFees).then(rows => {
                    rows.forEach(row => {
                        row.Selected = true;
                    });
                    rows[0].Element.focus();
                    this.ReloadSummary();
                });
            });
        }, () => { }, true, newItem.reverse());
    },
    CreateBookingLocal: function (btn) {
        var defaultFee = this.GET("DefaultFee");
        var inquiryDetail = this.GET("InquiryDetail");
        var units = [...new Set(defaultFee.AllListViewItem.map(x => x.Entity.Unit))];
        var components = [];
        var routes = inquiryDetail.AllListViewItem.filter(x => !x.GroupRow);
        var route = inquiryDetail.AllListViewItem.find(x => !x.GroupRow);
        if (routes.length > 1) {
            var routeCom = JSON.parse(JSON.stringify(defaultFee.Header.find(x => x.FieldName == "RouteId")));
            routeCom.FieldName = "ViewRouteId";
            routeCom.Id = null;
            routeCom.Events = `{"change":"UpdateViewForm"}`;
            components.push(routeCom);
        }
        else {
            this.Entity.ViewRouteId = `${(route.Entity.Pol.Code || '')} => ${(route.Entity.Pod.Code || '')}`;
        }
        var listFreight = [];
        if (defaultFee.AllListViewItem.some(x => x.Entity.IsFreight)) {
            listFreight.push({
                Id: "1",
                Name: "FREGIHT"
            });
        }
        if (defaultFee.AllListViewItem.some(x => x.Entity.IsLogistics)) {
            listFreight.push({
                Id: "2",
                Name: "LOGISTICS"
            });
        }
        if (defaultFee.AllListViewItem.some(x => x.Entity.IsTrucking)) {
            listFreight.push({
                Id: "3",
                Name: "TRUCKING"
            });
        }
        var freightCom = {
            FieldName: "FreightIds",
            ComponentType: "Dropdown",
            Query: JSON.stringify(listFreight),
            FormatData: "{Name}",
            Label: "Service",
            IsMultiple: true,
            PlainText: "Select service",
            Template: JSON.stringify([{ "FieldName": "Name", "Label": "Name", "ComponentType": "Input" }])
        }
        components.push(freightCom);
        var cwCom = JSON.parse(JSON.stringify(this.EditForm.ChildCom.find(x => x.Meta.FieldName == "CW").Meta));
        cwCom.FieldName = "View" + cwCom.FieldName;
        components.push(cwCom);
        var gwCom = JSON.parse(JSON.stringify(this.EditForm.ChildCom.find(x => x.Meta.FieldName == "GW").Meta));
        components.push(gwCom);
        gwCom.FieldName = "View" + gwCom.FieldName;
        this.EditForm.Entity.ViewGW = this.EditForm.Entity.GW;
        this.EditForm.Entity.ViewCW = this.EditForm.Entity.CW;
        this.UpdateViewForm();
        var form = this.EditForm.OpenConfig("Please double check async booking local!", () => {
            if (!this.EditForm.Entity.ViewCW) {
                return;
            }
            if (routes.length > 1) {
                route = inquiryDetail.AllListViewItem.find(x => !x.GroupRow && x.Entity.PolId == this.Entity.ViewRoute.PolId && x.Entity.PodId == this.Entity.ViewRoute.PodId);
            }
            if (!route) {
                return;
            }
            var featureName = "air-booking-local-editor";
            var config = JSON.parse(localStorage.getItem("SalesFunction"));
            var booking = JSON.parse(JSON.stringify(this.EditForm.Entity));
            let consigneText = "";
            let consignee = this.EditForm.Entity.Consignee;
            if (consignee) {
                consigneText += `${(consignee.CompanyName || '')}\n`;
                consigneText += `${(consignee.Address || '')}\n`;
                consigneText += `Tell: ${(consignee.PhoneNumber || '')} Fax: ${(consignee.Fax || '')}\n`;
                consigneText += `Contact person: ${(consignee.ContactName || '')}`;
            }
            let customerText = "";
            let customer = this.EditForm.Entity.Customer;
            if (customer) {
                customerText += `${(customer.CompanyName || '')}\n`;
                customerText += `${(customer.Address || '')}\n`;
                customerText += `Tell: ${(customer.PhoneNumber || '')} Fax: ${(customer.Fax || '')}\n`;
                customerText += `Contact person: ${(customer.ContactName || '')}`;
            }
            let shipper = this.EditForm.Entity.Shipper;
            let shipperText = "";
            if (shipper) {
                shipperText += `${(shipper.CompanyName || '')}\n`;
                shipperText += `${(shipper.Address || '')}\n`;
                shipperText += `Tell: ${(shipper.PhoneNumber || '')} Fax: ${(shipper.Fax || '')}\n`;
                shipperText += `Contact person: ${(shipper.ContactName || '')}`;
            }
            booking.ConsigneeDes = consigneText != "" ? consigneText : this.EditForm.Entity.ConsigneeIdText;
            if (booking.Service.Name.includes("Import")) {
                booking.ConsigneeDes = customerText != "" ? customerText : customerText;
                booking.ConsigneeId = booking.CustomerId;
            }
            else {
                booking.ConsigneeDes = consigneText != "" ? consigneText : this.EditForm.Entity.ConsigneeIdText;
            }
            if (booking.Service.Name.includes("Export")) {
                booking.ShipperDes = shipperText != "" ? shipperText : customerText;
                booking.ShipperId = booking.CustomerId;
            }
            else {
                booking.ShipperDes = shipperText != "" ? shipperText : this.EditForm.Entity.ShipperIdText;
            }
            booking.Id = this.Uuid7.NewGuid();
            booking.QuotationCode = this.EditForm.Entity.Code;
            booking.QuotationId = this.EditForm.Entity.Id;
            booking.CreatedOn = this.dayjs().format('YYYY-MM-DD');
            booking.SaleId = this.EditForm.Entity.Customer ? this.EditForm.Entity.Customer.SaleId : null;
            booking.PolId = route.Entity.PolId;
            booking.PodId = route.Entity.PodId;
            booking.PickupAddress = route.Entity.Pickup;
            booking.DeliveryAddress = route.Entity.Delivery;
            booking.PortTransitId = route.Entity.ViaId;
            booking.FinalDestinationId = route.Entity.FinalDestinationId;
            booking.PlaceDeliveryId = route.Entity.PlaceDeliveryId;
            booking.SpecialRequest = this.EditForm.Entity.Subject;
            booking.StatusId = config["APPROVE_BOOKINGLOCAL"] ? 3 : 1;
            booking.NoApproved = config["APPROVE_BOOKINGLOCAL"] ? true : false;
            booking.ContPickupAtId = this.EditForm.Entity.PkEmptyId;
            booking.InsertedBy = this.Token.UserId;
            booking.TypeId = 7;
            booking.VoucherTypeId = 3;
            if (route.Entity.Vendor && route.Entity.Vendor.PartnerTypeIdsText && route.Entity.Vendor.PartnerTypeIdsText.toUpperCase().includes('AGENT')
                && route.Entity.Vendor.ResidenceTypeIdText && route.Entity.Vendor.ResidenceTypeIdText.toUpperCase().includes('OVERSEA')) {
                booking.AgentId = route.Entity.VendorId;
                booking.VendorId = route.Entity.CarrierId;
            }
            else {
                booking.AgentId = null;
                booking.VendorId = route.Entity.VendorId;
                booking.CarrierId = route.Entity.CarrierId;
            }
            var bookingDetail = [];
            var sellingRate = JSON.parse(JSON.stringify(defaultFee.AllListViewItem.filter(x => x.Entity.PolId == route.Entity.PolId && x.Entity.PodId == route.Entity.PodId && !x.GroupRow && x.Entity.Rate && this.Decimal(x.Entity.Rate).greaterThan(0)).map(x => x.Entity)));
            var buyingRate = JSON.parse(JSON.stringify(defaultFee.AllListViewItem.filter(x => x.Entity.PolId == route.Entity.PolId && x.Entity.PodId == route.Entity.PodId && !x.GroupRow && x.Entity.Cost && this.Decimal(x.Entity.Cost).greaterThan(0)).map(x => x.Entity)));
            if (this.Decimal(this.EditForm.Entity.ViewCW).lessThan(this.Decimal(10))) {
                sellingRate = sellingRate.filter(x => x.Unit.Name.includes('-10') || x.Unit.Name.includes('ALL'));
                buyingRate = buyingRate.filter(x => x.Unit.Name.includes('-10') || x.Unit.Name.includes('ALL'));
            }
            else if (this.Decimal(this.EditForm.Entity.ViewCW).greaterThanOrEqualTo(this.Decimal(10)) &&
                this.Decimal(this.EditForm.Entity.ViewCW).lessThan(this.Decimal(45))) {
                sellingRate = sellingRate.filter(x => x.Unit.Name.includes('-45') || x.Unit.Name.includes('ALL'));
                buyingRate = buyingRate.filter(x => x.Unit.Name.includes('-45') || x.Unit.Name.includes('ALL'));
            }
            else if (this.Decimal(this.EditForm.Entity.ViewCW).greaterThanOrEqualTo(this.Decimal(45)) &&
                this.Decimal(this.EditForm.Entity.ViewCW).lessThan(this.Decimal(100))) {
                sellingRate = sellingRate.filter(x => x.Unit.Name.includes('+45') || x.Unit.Name.includes('ALL'));
                buyingRate = buyingRate.filter(x => x.Unit.Name.includes('+45') || x.Unit.Name.includes('ALL'));
            }
            else if (this.Decimal(this.EditForm.Entity.ViewCW).greaterThanOrEqualTo(this.Decimal(100)) &&
                this.Decimal(this.EditForm.Entity.ViewCW).lessThan(this.Decimal(300))) {
                sellingRate = sellingRate.filter(x => x.Unit.Name == '+100' || x.Unit.Name.includes('ALL'));
                buyingRate = buyingRate.filter(x => x.Unit.Name == '+100' || x.Unit.Name.includes('ALL'));
            }
            else if (this.Decimal(this.EditForm.Entity.ViewCW).greaterThanOrEqualTo(this.Decimal(300)) &&
                this.Decimal(this.EditForm.Entity.ViewCW).lessThan(this.Decimal(500))) {
                sellingRate = sellingRate.filter(x => x.Unit.Name == '+300' || x.Unit.Name.includes('ALL'));
                buyingRate = buyingRate.filter(x => x.Unit.Name == '+300' || x.Unit.Name.includes('ALL'));
            }
            else if (this.Decimal(this.EditForm.Entity.ViewCW).greaterThanOrEqualTo(this.Decimal(500)) &&
                this.Decimal(this.EditForm.Entity.ViewCW).lessThan(this.Decimal(1000))) {
                sellingRate = sellingRate.filter(x => x.Unit.Name == '+500' || x.Unit.Name.includes('ALL'));
                buyingRate = buyingRate.filter(x => x.Unit.Name == '+500' || x.Unit.Name.includes('ALL'));
            }
            else if (this.Decimal(this.EditForm.Entity.ViewCW).greaterThanOrEqualTo(this.Decimal(1000))) {
                sellingRate = sellingRate.filter(x => x.Unit.Name == '+1000' || x.Unit.Name.includes('ALL'));
                buyingRate = buyingRate.filter(x => x.Unit.Name == '+1000' || x.Unit.Name.includes('ALL'));
            }

            if (!this.EditForm.Entity.FreightIds.includes('1')) {
                sellingRate = sellingRate.filter(x => !x.IsFreight && (!x.IsLogistics || !x.IsTrucking));
                buyingRate = buyingRate.filter(x => !x.IsFreight && (!x.IsLogistics || !x.IsTrucking));
                if (this.EditForm.Entity.FreightIds.includes('2')) {
                    booking.TypeId = 9;
                    featureName = "logistics-booking-local-editor";
                    if (this.EditForm.Entity.Service.Name.includes('Sea Import')) {
                        booking.ServiceId = 4;
                    }
                    else if (this.EditForm.Entity.Service.Name.includes('Sea Export')) {
                        booking.ServiceId = 3;
                    }
                    else if (this.EditForm.Entity.Service.Name.includes('Air Export')) {
                        booking.ServiceId = 1;
                    }
                    else if (this.EditForm.Entity.Service.Name.includes('Air Import')) {
                        booking.ServiceId = 2;
                    }
                }
            }
            if (!this.EditForm.Entity.FreightIds.includes('2')) {
                sellingRate = sellingRate.filter(x => !x.IsLogistics);
                buyingRate = buyingRate.filter(x => !x.IsLogistics);
            }
            if (!this.EditForm.Entity.FreightIds.includes('3')) {
                sellingRate = sellingRate.filter(x => !x.IsTrucking);
                buyingRate = buyingRate.filter(x => !x.IsTrucking);
            }
            if (this.EditForm.Entity.FreightIds == '3') {
                booking.ServiceId = 13;
                booking.TypeId = 8;
                featureName = "trucking-booking-local-editor";
            }
            buyingRate.forEach(item => {
                var route = inquiryDetail.AllListViewItem.find(x => !x.GroupRow && x.Entity.PolId == item.PolId && x.Entity.PodId == item.PodId);
                item.Id = this.Uuid7.NewGuid();
                item.BookingId = booking.Id;
                if (!item.IsContainer) {
                    item.UnitId = item.OtherUnitId;
                }
                item.Amount = this.Decimal(item.Cost || 0);
                item.VendorId = item.PayeeId || route.Entity.VendorId;
                item.IsBuying = true;
                if (item.IsKGS) {
                    item.Quantity = !item.Quantity ? this.Decimal.max(this.Decimal(this.EditForm.Entity.ViewCW || 1), this.Decimal(item.MinQuantityCost || 1)) : this.Decimal(item.Quantity);
                }
                if (item.IsGrossWeight) {
                    item.Quantity = this.Decimal(this.EditForm.Entity.ViewGW || 1);
                }
                if (!item.Quantity) {
                    item.Quantity = item.Quantity ? this.Decimal(item.Quantity) : this.Decimal(1);
                }
                else {
                    item.Quantity = this.Decimal(item.Quantity);
                }
                item.TotalAmount = (item.Quantity || this.Decimal(0)).times(item.Amount || new this.Decimal(0));
                item.AmountTax = (item.TotalAmount).times(this.Decimal(item.Vat || 0)).div(100);
                item.TotalAmountTax = item.TotalAmount.plus(item.AmountTax);
                bookingDetail.push(item);
            });
            sellingRate.forEach(item => {
                item.Id = this.Uuid7.NewGuid();
                item.BookingId = booking.Id;
                if (!item.IsContainer) {
                    item.UnitId = item.OtherUnitId;
                }
                item.Amount = this.Decimal(item.Rate || 0);
                item.VendorId = item.PayerId || this.EditForm.Entity.CustomerId;
                if (item.IsKGS) {
                    item.Quantity = !item.Quantity ? this.Decimal.max(this.Decimal(this.EditForm.Entity.ViewCW || 1), this.Decimal(item.MinQuantityRate || 1)) : this.Decimal(item.Quantity);
                }
                if (item.IsGrossWeight) {
                    item.Quantity = this.Decimal(this.EditForm.Entity.ViewGW || 1);
                }
                if (!item.Quantity) {
                    item.Quantity = item.Quantity ? this.Decimal(item.Quantity) : this.Decimal(1);
                }
                else {
                    item.Quantity = this.Decimal(item.Quantity);
                }
                item.TotalAmount = (item.Quantity || this.Decimal(0)).times(item.Amount || new this.Decimal(0));
                item.AmountTax = (item.TotalAmount).times(this.Decimal(item.Vat || 0)).div(100);
                item.TotalAmountTax = item.TotalAmount.plus(item.AmountTax);
                bookingDetail.push(item);
            });
            booking.BookingDetail = bookingDetail.sort((a, b) => {
                const vendorCompare = a.VendorId.localeCompare(b.VendorId);
                if (vendorCompare !== 0) {
                    return vendorCompare;
                }
                return b.Amount - a.Amount;
            });
            this.OpenPopup(featureName, booking);
        }, () => { }, true, components);
    }
}

