        totalCostVND = totalCostVND.plus(vnd.CostAdd100);
        totalRevenueUSD = totalRevenueUSD.plus(usd.RevenueAdd100);
        totalCostUSD = totalCostUSD.plus(usd.CostAdd100);
    }
    if (bookingDetail.AllListViewItem.some(x => x.Entity.Unit && x.Entity.Unit.Name == "+300")) {
