    vnd.ProfitTotal = vnd.RevenueTotal.sub(vnd.CostTotal);
    vnd.ProfitRateTotal = (vnd.ProfitTotal.div(vnd.RevenueTotal || this.Decimal(1))).times(this.Decimal(100));

    usd.RevenueTotal = totalRevenueUSD;
    usd.CostTotal = totalCostUSD;
    usd.ProfitTotal = usd.RevenueTotal.sub(usd.CostTotal);
    usd.ProfitRateTotal = (usd.ProfitTotal.div(usd.RevenueTotal || this.Decimal(1))).times(this.Decimal(100));

    datas.push(vnd);
    datas.push(usd);
})
return datas;

